comments.body:
@sedgequeen FYI I use the epithet "borealis" to refer to all North American native populations. Alternatively this could be treated at the species level as A. borealis with multiple infraspecific taxa. The genetic data indicate that native North American plants are Pleistocene immigrants from eastern Asian via Beringia and thus are most closely related to eastern Asian species, not Achillea millefolium s.s. See https://www.researchgate.net/publication/233659687_AFLP_trees_versus_scatterplots_Evolution_and_phylogeography_of_the_polyploid_complex_Achillea_millefolium_agg_Asteraceae

While it would not be incorrect to label iNaturalist observations of native North American plants as "Achillea millefolium complex common yarrow species complex", the presence of introduced A. millefolium s.s. in parts of North America indicate the importance of distinguishing the native North American plants from A. millefolium s.s.  

Arthur Cronquist, in vol. 5 of Vascular Plants of the Pacific Northwest, provided a detailed discussion of how to distinguish the native from introduced members. I am not aware of introduced A. millefolium s.s in the Pacific Northwest but it seems possible that it could be here. Apparently it is well established in eastern North America.
